import React, { useState } from "react";
import Row from "./Row";

function Grid() {
  const [squareList, setSquareList] = useState([]);
  const size = 10;
  for (let i = 1; i <= size; i++) {
    for (let j = 1; j <= size; j++) {
      setSquareList([
        ...squareList,
        {
          id: (i - 1) * 10 + j,
          xPos: i,
          yPos: j,
          flipped: false,
        },
      ]);
    }
  }
  console.log(squareList);
  return <div>squareList</div>;
}

export default Grid;
